using System.Text;

namespace Advent_of_Code
{
    public class Day05
    {
        private static readonly string puzzleInput = "" ;
        private static readonly string alphabet = "abcdefghijklmnopqrstuvwxyz";

        public static int Part01()
        {
            return ReduceText(puzzleInput).Length;            
        }

        public static int Part02()
        {
            
            var answer = -1;
            var answerChar = "";
            foreach (var c in alphabet)
            {
                StringBuilder editedText = new StringBuilder(puzzleInput);
                var lower = c;
                var upper = char.ToUpper(lower);                
                for (int i = 0; i < editedText.Length; i++)
                {
                    if (editedText[i] == lower || editedText[i] == upper)
                    {
                        editedText.Remove(i, 1);
                        i--;

                    }
                    if (i == -1)
                    {
                        i = 0;
                    }                 

                }

                var reducedText = ReduceText(editedText.ToString());
                if(reducedText.Length < answer || answer == -1)
                {
                    answer = reducedText.Length;
                    answerChar = lower.ToString();
                }

            }

             return answer;
        }

        public static string ReduceText(string input)
        {
            char previousChar = '#';
            StringBuilder text = new StringBuilder(input);

            for (int i = 0; i < text.Length; i++)
            {
                var temp = text[i];
                if (char.IsUpper(temp))
                    temp = char.ToLower(temp);
                else if (char.IsLower(temp))
                    temp = char.ToUpper(temp);

                if (previousChar == temp)
                {
                    text.Remove(i, 1);
                    text.Remove(i - 1, 1);
                    i -= 2;

                }
                if(i== -1)
                {
                    i = 0;
                }
                previousChar = text[i];

            }

            return text.ToString() ;
        }

    }
}
